    "# Introduction\n",
    "- In todayâ€™s rapidly evolving job market, understanding the skills needed for Entry-Level Data Analyst and BI Analyst roles is crucial for aspiring and new professionals. This case study analyzes job postings from Indeed, Jobstreet, and Upwork to help create a learning plan tailored to the current market.\n",
    "- Skills for these roles are constantly changing, especially with AI. There are many tools to learn, each requiring time to master. This study highlights the most in-demand skills and tools, providing guidance on planning an efficient learning path for the most relative skills and tools in the industry.\n",
    "- Country of Interest : Philippines\n"
   ]
  },
