    "## Data Preparation\n",
    "### Data Sources\n",
    "- [**Indeed**](https://ph.indeed.com/) , [**Jobstreet**](https://www.jobstreet.com.ph/), [**Upwork**](https://www.upwork.com/)\n",
    "\n",
    "**Search Queries:** \n",
    "- Data Analyst Entry Level, Data Analyst No Experience\n",
    "- BI Analyst Entry Level, BI Analyst No Experience\n",
    "\n",
    "\n",
    "## Database Creation\n",
    "| Table Name         | Column Name               | Data Type     | Constraints                                    | Description                            |\n",
    "|--------------------|----------------------------|---------------|------------------------------------------------|----------------------------------------|\n",
    "| `jobs.job`         | job_id                     | SERIAL        | PRIMARY KEY                                     | Unique identifier for each job.        |\n",
    "|                    | job_title                  | VARCHAR(255)  | NOT NULL                                        | Title of the job.                      |\n",
    "|                    | location                   | VARCHAR(255)  | DEFAULT 'Unknown'                               | Location of the job.                   |\n",
    "|                    | job_type                   | VARCHAR(50)   | DEFAULT 'Not Specified'                         | Type of job (e.g., Full-time, Part-time). |\n",
    "|                    | setup                      | VARCHAR(50)   | CHECK (setup IN ('On-site', 'Hybrid', 'Remote')) | Work setup (e.g., On-site, Remote).     |\n",
    "| `jobs.salary`      | salary_id                  | SERIAL        | PRIMARY KEY                                     | Unique identifier for salary records.  |\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | salary_min                 | DECIMAL(15, 2)| DEFAULT NULL                                    | Minimum salary for the job.            |\n",
    "|                    | salary_max                 | DECIMAL(15, 2)| DEFAULT NULL                                    | Maximum salary for the job.            |\n",
    "|                    | salary_currency            | VARCHAR(10)   | DEFAULT 'Unknown'                               | Currency of the salary.                |\n",
    "| `jobs.responsibility` | responsibility_id         | SERIAL        | PRIMARY KEY                                     | Unique identifier for responsibilities.|\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | responsibility             | TEXT          |                                                | Description of the responsibility.     |\n",
    "|                    | responsibility_description | TEXT          |                                                | Detailed description of the responsibility. |\n",
    "|                    | responsibility_type        | VARCHAR(50)   |                                                | Type of responsibility (e.g., Core, Additional). |\n",
    "|                    | phase                      | VARCHAR(20)   |                                                | Phase of the responsibility (e.g., Initial, Ongoing). |\n",
    "| `jobs.soft_skill`  | soft_skill_id              | SERIAL        | PRIMARY KEY                                     | Unique identifier for soft skills.     |\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | soft_skill                 | VARCHAR(255)  |                                                | Name of the soft skill.                |\n",
    "|                    | skill_description          | TEXT          |                                                | Description of the soft skill.         |\n",
    "| `jobs.technical_skill` | technical_skill_id       | SERIAL        | PRIMARY KEY                                     | Unique identifier for technical skills.|\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | skill_description          | TEXT          |                                                | Description of the technical skill.    |\n",
    "|                    | specific_tool              | VARCHAR(255)  |                                                | Tool associated with the skill.        |\n",
    "|                    | category                  | VARCHAR(255)  |                                                | Category of the technical skill (e.g., Programming, Analysis). |\n",
    "| `jobs.qualification` | qualification_id          | SERIAL        | PRIMARY KEY                                     | Unique identifier for qualifications.  |\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | qualification_type         | VARCHAR(50)   |                                                | Type of qualification (e.g., Degree, Certification). |\n",
    "|                    | qualification_detail       | TEXT          |                                                | Detailed description of the qualification. |\n",
    "|                    | required                   | BOOLEAN       | DEFAULT FALSE                                   | Whether the qualification is required. |\n",
    "|                    | preferred                  | BOOLEAN       | DEFAULT FALSE                                   | Whether the qualification is preferred. |\n",
    "| `jobs.benefit`     | benefit_id                 | SERIAL        | PRIMARY KEY                                     | Unique identifier for benefits.        |\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | benefit_description        | TEXT          | DEFAULT 'No benefits specified'                 | Description of the benefits offered.   |\n",
    "| `jobs.schedule`    | schedule_id                | SERIAL        | PRIMARY KEY                                     | Unique identifier for schedules.       |\n",
    "|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n",
    "|                    | schedule_description       | TEXT          | DEFAULT 'No schedule specified'                 | Description of the schedule.           |\n"
